import axios from 'axios';
import * as ApiUrls from '../Constants/apiUrls';

class ThemesFetchApi {
  static themesFetch(req) {
    const reqObj = {
        method: 'POST',
        url: ApiUrls.productservice+'/themes/fetch',
        data: req
      };
    return axios(reqObj);
  }
}

export default ThemesFetchApi;
